import { Injectable } from '@angular/core';
import { HttpClient } from "@angular/common/http";


@Injectable({
  providedIn: 'root'
})

export class AuthServiceService {

constructor(private http: HttpClient ) { }

signupUser(data: any) {

  const apiUrl: string = `http://localhost:8080/api/add/organisation`;
  return this.http.post(apiUrl, data)


  fetch(`http://localhost:8080/api/add/organisation`, {
    method: 'POST',
    headers: {
        'Content-Type': 'application/json',
    },

})
    .then(response => response.json())
    .then(data => {
        if (data.status === 'Success') {
            localStorage.setItem('authToken', data.token);
            console.log('Token saved:', data.token);

            // Perform other actions, e.g., redirect to another page
        } else {
            console.error('Error:', data.message);
        }
    })
    .catch(error => {
        console.error('Error:', error);
    });

}


loginUser(data:any){
  const apiUrl : string = `http://localhost:8080/api/login/organisation`;
  return this.http.post(apiUrl, data)
}

getLoginUser(){
  const apiUrl : string = `http://localhost:8080/api/get/loginUser`;
  return this.http.get(apiUrl)
}



}
